import './App.css';
import React, {Component} from "react";
import Home from './components/Home/Home.js';
import News from './components/News/News.js';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

class App extends Component {
  render() {
    const About = () => {
      return <p>it`s 'about' page</p>
    }
    return (
      <>
        <Router>
          <div>
            <nav>
              <ul>
                <li>
                  <Link to="/">Home</Link>
                </li>
                <li>
                  <Link to="/about">About</Link>
                </li>
                <li>
                  <Link to="/news">News</Link>
                </li>
              </ul>
            </nav>
            <Switch>
              <Route path="/news">
                <News />
              </Route>
              <Route path="/about">
                <About />
              </Route>
              <Route path="/">
                <Home />
              </Route>
            </Switch>
          </div>
        </Router>
      </>
    );
  }
}

export default App;
